  <script>

    var dataCouleurs = {}
    var dataInfos = {}
    var nbJours;
    $(function() {
        $.get("./couleurs.csv", function (data) {
        //transformation en tableau, suppression du header et crÃ©ation du dictionnaire de correspondance entre nom complet / 3 lettres  (corresPays)
            data = $.csv.toArrays(data);
            data.shift()
            nbJours = data[0].length - 2;
            data.forEach(element => dataCouleurs[element.shift()] = element.map(function(v) {return v}));

            $.get("./infos.csv", function (data) {
                data = $.csv.toArrays(data);
                data.shift();
                nbJours = data[0].length - 2;
                data.forEach(element => dataInfos[element.shift()] = element.map(function(v) {return v}));

                $("#slider").append('<input type="range" id="index-range" name="index-range" step="1" min="0" max="'+nbJours+'" value="'+nbJours+'" style="width:20%;">  <label id="selected-index" for="index-range"></label>');
                $("#selected-index").text(nbJours);
                changeColors();
            });
        
        });
    });

    $("#slider").change( function(e) {
    //On fait la mise Ã  jour de la carte
        var selectedIndex = $("#index-range").val();
        $("#selected-index").text(selectedIndex);
        changeColors();
    });

    function changeColors(){
        var selectedIndex = $("#index-range").val();
        $( "#Circ > path" ).each(function( index, elem ) {
            console.log( this.id, dataCouleurs[this.id][selectedIndex] );

            $(elem).attr('fill',dataCouleurs[this.id][selectedIndex])
        });
    }
